  "userdoc": {
    "methods": {
      "getTokenAddressByIndex(uint256)": {
        "notice": "Given the known index of a token within the registry's symbol list, returns the address of the token mapped to the symbol at that index."
      },
      "getTokenAddressBySymbol(string)": {
        "notice": "Given a symbol, resolves the current address of the token the symbol is mapped to."
      },
      "getTokenAttributesByIndex(uint256)": {
        "notice": "Given the index for a token in the registry, returns a tuple containing the token's address, the token's symbol, and the token's name.     * Example:  getTokenAttributesByIndex(1);  => [\"0x06012c8cf97BEaD5deAe237070F9587f8E7A266d\", \"CK\", \"CryptoKitties\"]"
      },
      "getTokenAttributesBySymbol(string)": {
        "notice": "Given the symbol for a token in the registry, returns a tuple containing the token's address, the token's index in the registry, and the token's name.     * Example:  getTokenAttributesBySymbol(\"CK\");  => [\"0x06012c8cf97BEaD5deAe237070F9587f8E7A266d\", 1, \"CryptoKitties\"]"
      },
      "getTokenIndexBySymbol(string)": {
        "notice": "Given a symbol, resolves the index of the token the symbol is mapped to within the registry's symbol list."
      },
      "getTokenNameByIndex(uint256)": {
        "notice": "Given the index for a token in the registry, returns the name of the token as provided in the associated TokensAttribute struct.     * Example:  getTokenNameByIndex(1);  => \"CryptoKitties\""
      },
      "getTokenNameBySymbol(string)": {
        "notice": "Given a symbol, returns the name of the token the symbol is mapped to within the registry's symbol list."
      },
      "getTokenSymbolByIndex(uint256)": {
        "notice": "Given an index, resolves the symbol of the token at that index in the registry's token symbol list."
      },
      "setTokenAttributes(string,address,string)": {
        "notice": "Maps the given symbol to the given token attributes."
      }
    }
  }
